import axios from 'axios';
import React from 'react';


class Main extends React.Component {
    constructor(props)
    {
        super(props)
        const options = {
            method: 'GET',
            url: 'https://unogsng.p.rapidapi.com/genres',
            headers: {
              'X-RapidAPI-Key': '3e48e55c63msheacd6d577155f71p16348cjsn4d580b711657',
              'X-RapidAPI-Host': 'unogsng.p.rapidapi.com'
            }
          };
          
          axios.request(options).then(function (response) {
              console.log(response.data);
          }).catch(function (error) {
              console.error(error);
          });
    }
    render()
    {
        return (
            <div className="main">
                
                <img id='image' src="https://master-saydinga.ru/wp-content/uploads/kriptovalyuta.jpg"></img><br></br>
                <select id="list">
                    <option>Биткоин</option>
                    <option>Эфириум</option>
                    <option>Tether</option>
                    <option>BNB</option>
                </select><br></br>
                <input id="data" type="date" /><br></br>
                <button id="myButton" >Готово</button>
            </div>
        )
    }
}
export default Main
